import React, { useState, useEffect } from 'react';
import Table from 'react-bootstrap/Table';
import EleveService from '../../services/ServicesEleve';
import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';
import Button from 'react-bootstrap/Button';


export default function ListeEleveFiliere() {

    const [eleve, setEleve] = useState([]);


    // event.preventDefault();
    useEffect(() => {
        EleveService.getAllFiliereEleve()
            .then(res => {
                const listeEleve = res.data.Eleve;
                setEleve({ listeEleve });
                console.log(listeEleve);
            })
            .catch(function (error) {
                // handle error
                console.log(error);
            });
    }, [])
    const navigateUpdate = (id) => {
        history.push(
            '/UpdateEleve',
            {
                id_el: id,
            }
        )
    }
    return (
        <div className="login-wrapper">
            <Container>
                <Navbar expand="lg" variant="light" bg="light">
                    <Container>
                        <Navbar.Brand href="/InsertEleve">Nouveau Eleve</Navbar.Brand>
                    </Container>
                </Navbar>
            </Container>
            <Table striped bordered hover variant="dark">
                <thead>
                    <tr>
                        <th>#</th>
                        <th>Nom</th>
                        <th>Filiere</th>
                        <th>Niveau</th>
                        <th>Groupe</th>
                        <th></th>
                    </tr>
                </thead>
                <tbody>
                    {eleve?.listeEleve?.map(el => < tr >
                        <td key={{ el }} >{el.num_matricule}</td>
                        <td >{el.Eleve}</td>
                        <td >{el.Filiere}</td>
                        <td >{el.Niveau}</td>
                        <td >{el.Groupe}</td>
                        <td><Button variant="outline-info" onClick={() => navigateUpdate(el?.id)}>Modifier</Button></td>
                    </tr>)}
                </tbody>
            </Table >
        </div>
    )
}
